import React from 'react'
import { Route, Routes, BrowserRouter } from "react-router-dom";
import Home from '../components/page/Home';
import BoardAdmin from '../components/page/BoardAdmin';
import BoardModerator from '../components/page/BoardModerator';
import BoardUser from '../components/page/BoardUser';
import Profile from '../components/page/Profile';
import Register from '../components/login/Register';
import Login from '../components/login/Login';
import NoFoundPage from '../components/page/NoFoundPage';
export default function RoutePage() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Home */}
        <Route path="/home" element={<Home />}></Route>

        {/* Admin management */}
        <Route path="/admin" element={<BoardAdmin />}></Route>

        {/* Moderator management */}
        <Route path="/mod" element={<BoardModerator />}></Route>

        {/* User management */}
        <Route path="/user" element={<BoardUser />}></Route>

        {/* Profile */}
        <Route path="/profile" element={<Profile />}></Route>

        {/* Login */}
        <Route path="/register" element={<Register />}></Route>
        <Route path="/login" element={<Login />}></Route>


        {/* Profile */}
        <Route path="/profile" element={<Profile />}></Route>

        {/* Not Found Page */}
        <Route path="*" exact={true} element={<NoFoundPage />} />
      </Routes>
    </BrowserRouter>
  )
}
